import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useTheme } from '../hooks/useTheme';
import './Header.css';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [isScrolled, setIsScrolled] = useState(false);
  const { isDarkMode, toggleTheme } = useTheme();
  const navigate = useNavigate();

  // Handle scroll effect for navbar
  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 100);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      alert(`Searching for: ${searchTerm}`);
      setSearchTerm('');
    }
  };

  const handleAreaClick = (area) => {
    navigate(`/listings/${area}`);
    setIsMenuOpen(false);
  };

  const scrollToAreas = (e) => {
    e.preventDefault();
    if (window.location.pathname === '/') {
      const areasSection = document.getElementById('areas');
      if (areasSection) {
        areasSection.scrollIntoView({ behavior: 'smooth' });
      }
    } else {
      navigate('/');
      setTimeout(() => {
        const areasSection = document.getElementById('areas');
        if (areasSection) {
          areasSection.scrollIntoView({ behavior: 'smooth' });
        }
      }, 100);
    }
    setIsMenuOpen(false);
  };

  return (
    <div className="nav-container">
      <nav className={`navbar ${isScrolled ? 'scrolled' : ''}`}>
        <Link to="/" className="logo" onClick={() => setIsMenuOpen(false)}>
          Shiva Associates
        </Link>

        <div 
          className="mobile-menu-icon" 
          onClick={() => setIsMenuOpen(!isMenuOpen)}
        >
          <i className="fas fa-bars"></i>
        </div>

        <ul className={`nav-links ${isMenuOpen ? 'open' : ''}`}>
          <li>
            <Link to="/" onClick={() => setIsMenuOpen(false)}>Home</Link>
          </li>
          <li>
            <a href="#areas" onClick={scrollToAreas}>Areas</a>
          </li>
          <li className="nav-item dropdown">
            <a href="#listings">
              Listings <i className="fas fa-chevron-down"></i>
            </a>
            <div className="dropdown-menu">
              <a href="#" onClick={() => handleAreaClick('central-noida')}>
                Central Noida
              </a>
              <a href="#" onClick={() => handleAreaClick('noida-expressway')}>
                Noida Greater Noida Expressway
              </a>
              <a href="#" onClick={() => handleAreaClick('yamuna-expressway')}>
                Yamuna Expressway
              </a>
            </div>
          </li>
          <li>
            <Link to="/contact" onClick={() => setIsMenuOpen(false)}>Contact</Link>
          </li>
        </ul>

        <div className="search-container">
          <div className="theme-toggle" onClick={toggleTheme}>
            <i className={`fas ${isDarkMode ? 'fa-sun' : 'fa-moon'}`}></i>
            <span>{isDarkMode ? 'Light' : 'Dark'}</span>
          </div>

          <form onSubmit={handleSearch} className="search-form">
            <input
              type="text"
              className="search-box"
              placeholder="Search properties, areas..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button type="submit" className="search-btn">
              <i className="fas fa-search"></i>
            </button>
          </form>
        </div>
      </nav>
    </div>
  );
};

export default Header;
